Hi Welcome to Rss Shop!

The shape of the feeding port is round.

Additional functions of juicer: juicing;

Fuselage material: plastic;

Capacity: 350 mL or less;

Function: juice extraction;

Color: blue, purple, green, pink;

Name: Portable electric juice cup (with charging line)

Function: Pressing juice, stirring

Material: Food grade PP+PC+ABS+304 stainless steel

Colour: Purple, Rose, Blue, Green, Orange

Weight: about 600g/

Packing: cylinder packing

Before using the product for the first time, make sure that the battery is fully charged and reused, and thoroughly clean the parts in contact with the food.



